import stream from 'stream'

const NEW_LINE = '\n'
const NO_MATCH = 'NO MATCH'

const Transform = stream.Transform

/**
 * A streaming string matcher.
 * Matches strings in a stream to known patterns.
 */
class Matcher extends Transform {

  /**
   * Construct transform.
   * @param {Patterns} patterns - a Patterns instance to match patterns from.
   */
  constructor (patterns) {

    super()

    this.patterns = patterns
  }

  /**
   * transform stream.
   */
  _transform (chunk, encoding, processed) {

    // Convert the chunk to a string.
    const string = chunk.toString()

    // Check string for a pattern match.
    let match = this.patterns.match(string)

    // If no match; default to no match string.
    match = match || NO_MATCH

    // Push match string into stream.
    this.push(match + NEW_LINE)

    processed()
  }
}
export default Matcher

import stream from 'stream'
import Format from './Format'
import Pattern from './Pattern'
import Utilities from './Utilities'

const Transform = stream.Transform

/**
 * Stream parser
 */
class Parser extends Transform {

  /**
   * Construct transform.
   * @param {Patterns} patterns - a Patterns instance to collect patterns found.
   * @param {Format} format - a Format to parse in.
   */
  constructor (patterns, format = Format) {

    super()

    this.format = format
    this.patterns = patterns
    this.lineNumber = 1
    this.numberOfPaths = 0
    this.numberOfPatterns = 0
  }

  /**
   * Advances the parser to the next line.
   */
  nextLine () {

    // Advance line number to the next line.
    this.lineNumber++
  }

  /**
   * transform stream.
   */
  _transform (chunk, encoding, processed) {

    // Convert the chunk to a string.
    const string = chunk.toString()

    // If on the line which specifies the number of patterns.
    if (this.format.isNumberOfPatternsLine(this.lineNumber)) {

      // Parse the string as a number and record the number of patterns.
      this.numberOfPatterns = Utilities.parseNumber(string)
    }

    // If on a pattern line.
    else if (this.format.isPatternLine(this.lineNumber, this.numberOfPatterns)) {

      // Create a new pattern from the string.
      const pattern = new Pattern(string)

      // Add the pattern to the patterns.
      this.patterns.add(pattern)
    }

    // If on the line which specifies the number of paths.
    else if (this.format.isNumberOfPathsLine(this.lineNumber, this.numberOfPatterns)) {

      // Parse the string as a number and record the number of paths.
      this.numberOfPaths = Utilities.parseNumber(string)
    }

    // If on a path line.
    else if (this.format.isPathLine(this.lineNumber, this.numberOfPatterns, this.numberOfPaths)) {

      // Push the string through the stream.
      this.push(`${string}\n`)
    }

    this.nextLine()

    processed()
  }
}

export default Parser

/**
 * A representation of a pattern.
 */
class Pattern {

    /**
     * Construct a {Pattern}
     * Construct a new {Pattern} from a given string
     * @param {String} string - a string to use to construct pattern from.
     */
    constructor (string) {

        string = String(string)

        // Store the original string.
        this.originalPattern = string

        // Split the string into a tokens.
        this.tokens = string.split(',')

        // Covert string into a regular expression.
        this.regularExpression = new RegExp(string.replace(/,/g, '/')
                                                  .replace(/\*/g, '.*'))

        // Count of wildcards in the pattern.
        this.wildcards = 0

        // Location of the left most wildcard.
        this.leftMostWildcardIndex = null

        this.tokens.forEach((token, index) => {

            // If the token is a wildcard.
            if (token === '*') {

                this.wildcards++

                if (this.leftMostWildcardIndex === null) this.leftMostWildcardIndex = index
            }
        })
    }

    /**
     * Match pattern.
     * Matches a string to this pattern.
     * @param {String} string - string to match.
     * @return {Boolean} true if the string matches this pattern; false
     * otherwise.
     */
    match (string) {

        return String(string).match(this.regularExpression)
    }

    /**
     * Compare pattern.
     * Compares a given pattern against this pattern.
     * @param {Pattern} pattern - a pattern to compare against.
     * @return {Pattern} the winning {Pattern}.
     */
    compare (pattern) {

        // Return this pattern if there is nothing to compare
        if (!pattern) return this

        // If the patterns have the same number of wildcards.
        if (pattern.wildcards === this.wildcards) {

            // If the patterns left most wildcard is further to the right then
            // return the pattern; otherwise return this pattern.
            if (pattern.leftMostWildcardIndex > this.leftMostWildcardIndex) return pattern
            else return this
        }

        // If the pattern has less wildcards that this pattern then return the
        // pattern.
        else if (pattern.wildcards < this.wildcards) return pattern

        // Otherwise; return this pattern.
        else return this
    }

    /**
     * Convert to string.
     * Convert {Pattern} to {String}.
     * @return {String} string representation of the pattern.
     */
    toString () {

        return this.originalPattern
    }
}

export default Pattern

/**
 * A collection of patterns.
 * Collects and stores {Pattern}s to be matched.
 */
class Patterns {

    /**
     * Construct Patterns.
     */
    constructor () {

        this.patterns = []
    }

    /**
     * Add a pattern.
     * @param {Pattern} pattern - the pattern to add.
     */
    add (pattern) {

        this.patterns.push(pattern)
    }

    /**
     * Match a string to a known pattern.
     * NOTE: The matching algorithm used has not been optimized. It is currently
     * O(n) where n is the number of patterns.
     * TODO: Improve efficiency.
     * @param {String} string - the string to check for a match.
     * @return {Pattern|null} either the matched {Pattern} or null if no match.
     */
    match (string) {

        let match = null

        /**
         * Matches a pattern
         * @param {Pattern} pattern - pattern to match.
         */
        function matchPattern (pattern) {

            // If the string matches the pattern.
            if (pattern.match(string)) {

                // Compare against previous match and update.
                match = pattern.compare(match)
            }
        }

        // Match against each pattern.
        this.patterns.forEach(matchPattern)

        return match
    }
}

export default Patterns

/**
 * A set of helper utilities.
 */
class Utilities {

  /**
   * Parses an input given as a number or string into an integer.
   * @param {Number|String} number - input to parse.
   * @throws {Error} if the input can not be parsed into an integer.
   * @returns {Number} a integer.
   */
  static parseNumber (number) {

    number = Number(number)

    if (Number.isNaN(number)) throw new Error('Not a number')
    if (!Number.isInteger(number)) throw new Error('Not an integer')

    return number
  }
}

export default Utilities

import split from 'split'
import Parser from './Parser'
import Matcher from './Matcher'
import Patterns from './Patterns'

function WP (input, output) {

  const patterns = new Patterns()
  const parser = new Parser(patterns)
  const matcher = new Matcher(patterns)

  input
  .setEncoding('ascii')
  .pipe(split())
  .pipe(parser)
  .pipe(matcher)
  .pipe(output)
}

export default WP
